import React from 'react'


const Cell = () => {
  return( 
  <div style={style.cellStyle}>
    <input></input>
  </div>
    
  )
};
const style = {
  cellStyle:{
    width:40, height:40, background: "lightgrey",
    display:'flex',
    justifyContent:'center',
    alignItems:'center',
    border: '2px solid red'  
  }
}
export default Cell
